import Sidebar from "./Components/Sidebar";
import Navbar from "./Components/Navbar";
import './style.css'

function App() {
  return (
    <>
      <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
        <div className="container">
          <Navbar></Navbar>
        </div>
      </nav>
      <div className="container-fluid">
        <Sidebar></Sidebar>
      </div>
    </>
  );
}
export default App;
